import{_ as t,c as e,o,b as a}from"./app.6fdcbe56.js";const s="/images/yellow_code.jpg",p="/images/record.jpg",c="/images/seal.jpg",i="/images/first_meal.jpg",r="/images/draw_avatar.jpg",v=JSON.parse('{"title":"\u98CE\u8FC7\u65E0\u75D5","description":"","frontmatter":{"title":"\u98CE\u8FC7\u65E0\u75D5"},"headers":[{"level":2,"title":"\u9694\u79BB","slug":"\u9694\u79BB"},{"level":2,"title":"\u9009\u62E9","slug":"\u9009\u62E9"},{"level":2,"title":"\u601D\u4E0E\u613F","slug":"\u601D\u4E0E\u613F"}],"relativePath":"mood/wind.md"}'),l={name:"mood/wind.md"},d=a('<p>\u4ECA\u5929\u662F 2022 \u5E74 1 \u6708 12 \u65E5\uFF0C\u88AB\u9694\u79BB\u7684\u7B2C\u4E00\u5929\uFF5E</p><h2 id="\u9694\u79BB" tabindex="-1">\u9694\u79BB <a class="header-anchor" href="#\u9694\u79BB" aria-hidden="true">#</a></h2><p>1 \u6708 9 \u65E5\uFF0C\u6B63\u5728\u5916\u9762\u5BFB\u89C5\u6838\u9178\u68C0\u6D4B\u70B9\u7684\u65F6\u5019\uFF0C\u8001\u54E5\u4E00\u4E2A\u7535\u8BDD\u5F00\u5934\u5C31\u8BF4\uFF1A\u6211\u8981\u544A\u8BC9\u4F60\u4E2A\u4E8B\u513F...</p><p>\u6211\u8FD8\u5728\u60F3\uFF0C\u8FD9\u80FD\u6709\u4EC0\u4E48\u4E8B\u513F\u8FD8\u8981\u4E13\u95E8\u6253\u4E2A\u7535\u8BDD\u8BF4\uFF1F\uFF08\u56E0\u4E3A\u4E00\u822C\u90FD\u5FAE\u4FE1\u804A\u5929\u513F\u7684\u561B\uFF09</p><p>\u7136\u540E\u4E0B\u4E00\u53E5\uFF1A\u524D\u4E24\u5929\u53D1\u73B0\u7684\u65B0\u51A0\u80BA\u708E\u9633\u6027\u60A3\u8005\u53BB\u8FC7\u9F99\u5C97\u533A\u4E07\u8C61\u6C47\uFF0C\u4F60\u770B\u4E00\u4E0B\u4F60\u7684\u5065\u5EB7\u7801\u9EC4\u4E86\u6CA1\u6709\uFF0C\u4F60\u5AC2\u5B50\u7684\u9EC4\u4E86\uFF0C\u6211\u7684\u6CA1\u6709</p><p>\u5FC3\u5934\u4E00\u7D27\uFF0C\u8D76\u7D27\u7FFB\u51FA\u6765\u4E00\u770B\uFF0C\u679C\u7136\uFF0C\u9EC4\u4E86...\uFF08\u56E0\u4E3A\u6211\u8DDF\u5AC2\u5B50\u90FD\u5728\u90A3\u91CC\u4E70\u8FC7\u5355\uFF0C\u4F46\u8001\u54E5\u6CA1\u6709\uFF09\u3002\u65E2\u7136\u9EC4\u4E86\uFF0C\u5C31\u5F97\u53BB\u901A\u8FC7 &quot;\u4E09\u5929\u4E24\u6D4B&quot; \u6765\u786E\u5B9A\u662F\u5426\u5B58\u5728\u53EF\u80FD\u88AB\u611F\u67D3\u7684\u60C5\u51B5\uFF08\u6240\u5E78\uFF0C\u4E24\u6B21\u6838\u9178\u68C0\u6D4B\u7684\u7ED3\u679C\u90FD\u662F\u9634\u6027\uFF09</p><div style="display:flex;align-items:center;"><img src="'+s+'" alt="yellow code" width="200" style="margin-right:20px;"><img src="'+p+'" alt="test record" width="200"></div><p>\u4F46\u8FD1\u4E24\u5929\u53C8\u51FA\u73B0\u4E86\u65B0\u7684\u611F\u67D3\u8005\uFF0C\u800C\u4E14\u90FD\u662F\u7531\u4E8E\u8DDF\u4E4B\u524D\u68C0\u6D4B\u5230\u7684\u5177\u6709\u95F4\u63A5\u6216\u8005\u76F4\u63A5\u63A5\u89E6\u8005\uFF0C\u56E0\u800C\u597D\u50CF\u662F\u4ECE\u6628\u5929\u8D77\uFF0C\u9886\u5BFC\u53D1\u8BDD\u51E1\u662F\u6D89\u53CA\u5230\u6709\u7A7A\u95F4\u63A5\u89E6\u6216\u8005\u95F4\u63A5\u63A5\u89E6\u8005\u5747\u9700\u8981\u8FDB\u884C\u5C45\u5BB6\u9694\u79BB\uFF0C\u7531\u793E\u533A\u5DE5\u4F5C\u8005\u3001\u793E\u5EB7\u533B\u751F\u7B49\u7EC4\u6210\u7684\u76D1\u7763\u670D\u52A1\u5C0F\u7EC4\u5BF9\u6211\u4EEC\u8FD9\u7C7B\u6F5C\u5728\u98CE\u9669\u4EBA\u7FA4\u8FDB\u884C\u5C45\u5BB6\u9694\u79BB\u533B\u5B66\u89C2\u5BDF\uFF08\u6BD5\u7ADF\u53EF\u80FD\u662F\u65E0\u75C7\u72B6\u611F\u67D3\uFF0C\u8FD8\u5728\u6F5C\u4F0F\u671F\u4E5F\u8BF4\u4E0D\u5B9A\uFF09</p><p>\u90A3\u4E48\u7ED3\u679C\u5C31\u662F\uFF1A\u4ECE\u4ECA\u5929\u8D77\uFF0C\u6211\u5C06\u5F00\u542F 14 \u5929\u7684\u95ED\u5173\u751F\u6D3B\u4E86\uFF5E <s>\uFF08\u52FF\u5FF5\uFF09</s></p><p>\u5E0C\u671B\u8FD8\u662F\u6CA1\u6709\u88AB\u611F\u67D3\u5427\uFF0C\u5766\u7136\u9762\u5BF9\uFF0C\u6BD5\u7ADF\u662F\u5426\u4F1A \u201C\u4E2D\u5956\u201D\uFF0C\u4F60\u7684\u62C5\u5FC3\u5176\u5B9E\u4E5F\u6BEB\u65E0\u610F\u4E49</p><img src="'+c+'" alt="seal" width="300"><p>\u867D\u7136\u4E8E\u6211\u800C\u8A00\uFF0C\u8DDF\u653E\u5047\u7684\u6211\u6CA1\u591A\u5C11\u533A\u522B\uFF08\u6211\u60F3\u533A\u522B\u5C31\u662F\u5DE5\u4F5C\u65E5\u5FC5\u987B\u5F97\u5728\u7EBF\u4E0A\u652F\u6301\u5DE5\u4F5C\uFF0C\u7136\u540E\u4E0D\u80FD\u60F3\u51FA\u53BB\u5C31\u51FA\u53BB\u4E86\uFF0C\u4E5F\u4EC5\u6B64\u800C\u5DF2\uFF09</p><p>\u8FD9\u5C31\u662F\u9694\u79BB\u540E\u7684\u7B2C\u4E00\u9910\u5566\uFF08\u7B80\u5355\u5403\u4E00\u4E0B\u5427\uFF09\uFF01</p><img src="'+i+'" alt="first meal"><h2 id="\u9009\u62E9" tabindex="-1">\u9009\u62E9 <a class="header-anchor" href="#\u9009\u62E9" aria-hidden="true">#</a></h2><div class="tip custom-block"><p class="custom-block-title">\uFF1F</p><p>\u540E\u6765\uFF0C\u603B\u6709\u4EBA\u4F1A\u95EE\u81EA\u5DF1\u8FD9\u4E48\u4E2A\u95EE\u9898\uFF1A\u5982\u679C\u4E00\u5207\u53EF\u4EE5\u91CD\u6765\uFF0C\u4F60\u4F1A\u5982\u4F55\u9009\u62E9\uFF1F</p></div><p>\u6BCF\u4E00\u53E5 &quot;\u60F3\u5230\u4F60\u5C31\u54ED\u4E86&quot; \u5176\u5B9E\u90FD\u770B\u89C1\u4E86\uFF0C\u4F46\uFF0C\u6211\u7684\u7406\u667A\u603B\u4F1A\u5360\u636E\u4E0A\u98CE\u3002<code>\u8DDD\u79BB</code>\u3001<code>\u5B66\u4E60</code>\u3001<code>\u5DE5\u4F5C</code>\u3001<code>\u751F\u6D3B</code>... \u65B9\u65B9\u9762\u9762\u90FD\u9694\u5F97\u592A\u8FDC\uFF0C\u8FD8\u8BB0\u5F97\u4EE5\u524D\u4E00\u4E2A\u6708\u89C1\u4E00\u6B21\u7684\u65F6\u5019\u4F60\u8BF4\u8FC7\uFF1A&quot;\u6211\u90FD\u5FEB\u4E0D\u8BB0\u5F97\u4F60\u957F\u4EC0\u4E48\u6837\u4E86&quot;\uFF0C\u73A9\u7B11\u7684\u8BDD\u8BED\u6D0B\u6EA2\u7740\u60F3\u5FF5\u7684\u671F\u671B\uFF0C\u4E5F\u5F3A\u8C03\u7740\u73B0\u5B9E\u7684\u5DEE\u8DDD</p><p>\u6709\u65F6\u5019\u4E0D\u7981\u4F1A\u60F3\uFF1A\u518D\u6B21\u91CD\u8E48\u8986\u8F99\u548C\u4ECE\u6B64\u5F62\u540C\u964C\u8DEF\u54EA\u4E2A\u66F4\u597D\uFF1F</p><p>\u5076\u5C14\u4F1A\u60F3\u51B2\u52A8\u4E00\u4E0B\u5B50\uFF0C\u6253\u5F00\u804A\u5929\u754C\u9762\u6216\u8005\u770B\u7740\u624B\u673A\u53F7\u72EC\u5750\u7740\u770B\u4E86\u8BB8\u4E45\uFF0C\u8FD8\u662F\u9009\u62E9\u9ED8\u9ED8\u5173\u95ED\u3002\u5076\u5C14\u56DE\u590D\u7684\u6D88\u606F\u4E5F\u4F1A\u518D\u4E09\u786E\u8BA4\u6CA1\u6709\u66F4\u591A\u5730\u4FE1\u606F\u63BA\u6742\u624D\u70B9\u51FB\u53D1\u9001\uFF0C\u66FE\u7ECF\u7684\u4F60\uFF0C\u8BA9\u6211\u6E10\u6E10\u89C9\u5F97\u597D\u50CF\u4E00\u4E2A\u4EBA\u5C31\u633A\u597D\u3002\u867D\u7136\u6211\u9690\u7EA6\u89C9\u5F97\u4F60\u73B0\u5728\u8FD8\u662F\u9009\u62E9\u4ED6\uFF0C\u5FC3\u91CC\u4F9D\u7136\u4F1A\u89C9\u5F97\u4E0D\u8212\u670D\uFF0C\u4F46\u6211\u60F3\u53EF\u80FD\u662F\u4ED6\u6539\u8FC7\u6765\u4E86\u5427\uFF01\uFF08\u8FD9\u6BB5\u7684\u66F4\u65B0\u65F6\u95F4\u5DF2\u7ECF\u662F <code>\u4E8C\u96F6\u4E8C\u4E8C\u5E74\u7684\u516B\u6708\u4EFD</code> \u4E86\uFF0C\u4E00\u76F4\u4EE5\u6765\u7684\u610F\u96BE\u5E73\u8FD8\u662F\u4E00\u5982\u65E2\u5F80\u5427\uFF0C\u6BD5\u7ADF\u4E3B\u8981\u662F\u5BF9\u81EA\u5DF1\u7684\u4E0D\u6EE1\u610F\uFF0C\u5BB3\u6015\u7ED9\u4E0D\u4E86\u7684\u4E1C\u897F\u592A\u591A\uFF0C\u8BA9\u4F60\u66F4\u65E9\u5730\u5931\u671B\u53CD\u800C\u66F4\u597D\uFF09</p><blockquote><p>\u300C\u7231\u60C5\u516C\u5BD3\u300D\u4E2D\u5415\u5B50\u4E54\u6709\u4E00\u53E5\u53F0\u8BCD\uFF1A<br> \u5168\u4E16\u754C\u4EFB\u4F55\u6F02\u4EAE\u6709\u9B45\u529B\u7684\u5973\u751F\uFF0C\u90FD\u4E0D\u4F1A\u56E0\u4E3A\u4F60\u9001\u5979\u6C49\u5821\u6216\u5976\u8336\u800C\u5BF9\u4F60\u8BF4\u6211\u7231\u4F60\uFF0C\u660E\u767D\u5417\uFF1F</p></blockquote><p>\u4EBA\u5BB6\u8BF4\uFF0C\u4E92\u76F8\u559C\u6B22\u561B\uFF0C\u611F\u60C5\u6700\u91CD\u8981\uFF01\u4F46\u751F\u6D3B\u5E76\u4E0D\u5168\u662F\u611F\u60C5\uFF0C\u66FE\u7ECF\u6211\u89C9\u5F97\u6709\u4E00\u4E2A\u4EBA\u966A\u7740\u4E00\u8D77\uFF0C\u6240\u6709\u7684\u95EE\u9898\u90FD\u4E0D\u662F\u95EE\u9898\uFF0C\u4E5F\u66FE\u61A7\u61AC\u7740\u672A\u6765\uFF0C\u8DDF\u4F60\u804A\u7740\u53EF\u80FD\u7684\u4E00\u5207\uFF0C\u73B0\u5728\u5076\u5C14\u8FD8\u662F\u4F1A\u8FD9\u6837\u60F3\uFF0C\u4F46\u60F3\u60F3\u8FD8\u662F\u5F88\u5E7C\u7A1A\uFF0C\u54C8\u54C8\u54C8...</p><p>\u65F6\u95F4\uFF0C\u4E0D\u662F\u65E0\u9650\u5FAA\u73AF\u7684\uFF0C\u65E2\u7136\u5DF2\u7ECF\u505A\u4E86\u9009\u62E9\uFF0C\u6216\u8005\u662F &quot;\u88AB&quot; \u9009\u62E9\uFF0C\u4F60\u5C31\u5E94\u8BE5\u63A5\u53D7\u8FD9\u4EFD\u9009\u62E9\u6240\u5E94\u8BE5\u6709\u7684\u610F\u4E49\uFF0C\u5E76\u4E14\u627F\u53D7\u5B83\u7684\u540E\u679C \u27A1\uFE0F <a href="https://mp.weixin.qq.com/s/HCuRN25_7TPFUG3B1vu5JA" target="_blank" rel="noreferrer">\u5220\u6389\u4ED6\uFF0C\u5C31\u4E0D\u4F1A\u6709\u90A3\u4E48\u591A\u70E6\u607C\u4E86</a>\uFF08\u53CD\u6B63\u88AB\u5220\u4E60\u60EF\u4E86\uFF0C\u8086\u65E0\u5FCC\u60EE\u5730\u88AB\u4F24\u5BB3\u611F\u53D7\u5230\u7684\u6253\u51FB\u4E5F\u662F\u771F\u7684\uFF09</p><h2 id="\u601D\u4E0E\u613F" tabindex="-1">\u601D\u4E0E\u613F <a class="header-anchor" href="#\u601D\u4E0E\u613F" aria-hidden="true">#</a></h2><div class="tip custom-block"><p class="custom-block-title">\u9C81\u8FC5\u7248\u7684\u601D</p><p>\u9662\u5185\u7684\u67A3\u6811\u4E0D\u77E5\u600E\u7684\uFF0C\u4ECA\u5E74\u4E5F\u7ED3\u4E86\u51E0\u9897\u679C\u5B9E\uFF0C\u4E0D\u597D\uFF0C\u7565\u663E\u82E6\u6DA9\uFF0C\u4F46\u8F6C\u5FF5\u4E00\u60F3\u3002\u6628\u665A\u68A6\u91CC\u7684\u5979\uFF0C\u5012\u53C8\u662F\u751C\u4E86\u4E00\u5206</p></div><p>2010 \u5E74\u80E1\u6B4C\u4E3B\u6F14\u7684\u90A3\u7248\u300A\u795E\u8BDD\u300B\u91CC\u8001\u5D14\u5BF9\u6613\u5C0F\u5DDD\u8BB2\u7684\u6709\u8FD9\u4E48\u4E00\u53E5\u53F0\u8BCD\uFF1A</p><div class="danger custom-block"><p class="custom-block-title">\u65C5\u8005</p><p>\u867D\u7136\u662F\u5C71\u5DDD\u7F8E\u666F\u8FD1\u5728\u773C\u524D\uFF0C\u6211\u5374\u53EA\u662F\u4E00\u4E2A\u5306\u5306\u65C5\u8005\uFF0C\u65E0\u6CD5\u9A7B\u8DB3\u6D41\u8FDE\uFF0C\u4F60\uFF0C\u53C8\u4F55\u5C1D\u4E0D\u662F\u5982\u6B64\u5462\uFF1F</p></div><p>\u6709\u65F6\u5019\u6CA1\u4E8B\u505A\u7684\u65F6\u5019\uFF0C\u4F1A\u60F3\u7740\u753B\u4E00\u70B9\u4E1C\u897F\uFF0C\u4F46\u4E5F\u53EA\u662F\u4E00\u65F6\u5174\u8D77... \uFF08\u53EA\u6709\u524D\u4E24\u4E2A\u662F\u6211\u753B\u7684\uFF09</p><img src="'+r+'" alt="avatar"><p>\u6700\u540E\uFF0C\u8FD8\u662F\u9001\u7ED9\u4F60\u4E00\u53E5\u8BDD</p><div class="info custom-block"><p class="custom-block-title">\u5B89\u597D</p><p>\u4EC5\u613F\u4F60\uFF0C\u80FD\uFF08\u5DF2\uFF09\u9047\u826F\u4EBA<br> \u5728\u6211\u770B\u4E0D\u5230\u7684\u5730\u65B9 [\u5B89\u7136\u65E0\u6059]<br> \u5982\u6B64\uFF0C\u4FBF\u597D...</p></div><blockquote><p>BGM\uFF1A<a href="https://www.kugou.com/song/#hash=A6EF5D3D86966B955507334FB21BD0F5&amp;album_id=35896338" target="_blank" rel="noreferrer">\u300A\u795E\u8BDD\uFF08\u7B1B\u5B50\u7EAF\u97F3\u4E50\uFF09\u300B</a><br><br><audio src="https://webfs.ali.kugou.com/202208242324/8a6e8aabf71388fb9a929f65ed093130/v2/a6ef5d3d86966b955507334fb21bd0f5/G188/M00/1D/11/XIcBAF4gHC6ALbl7ADl7f4kt6T8070.mp3" controls autoplay preload="auto"></audio></p></blockquote>',31),n=[d];function m(_,u,h,b,g,f){return o(),e("div",null,n)}const q=t(l,[["render",m]]);export{v as __pageData,q as default};
